    public static ArrayList<Long> orderByPoints(ArrayList<Long> nums) {
        ArrayList<Long> result = new ArrayList<Long>();
        ArrayList<Long> temp = new ArrayList<Long>();
        for(int i = 0; i < nums.size(); i++){
            temp.add(nums.get(i));
        }
        for(int i = 0; i < nums.size(); i++){
            int max = Integer.MIN_VALUE;
            int index = 0;
            for(int j = 0; j < temp.size(); j++){
                int sum = 0;
                for(int k = 0; k < String.valueOf(temp.get(j)).length(); k++){
                    sum += Integer.parseInt(String.valueOf(temp.get(j)).charAt(k) + "");
                }
                if(sum > max){
                    max = sum;
                    index = j;
                }
            }
            result.add(temp.get(index));
            temp.remove(index);
        }
        return result;

