                xor[i] = aBin[i];
            } else {
                xor[i] = bBin[i];
            }
        }
        // Convert binary array to string.
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < xor.length; i++) {
            sb.append(xor[i]);
        }
        return sb.toString();

